import React, { useEffect, useState } from 'react';

// --- IMPORTAM IMAGINILE (Asigura-te ca ai folderul src/assets/badges creat) ---
// Daca imaginile tale sunt in alta parte, modifica calea aici.
import dailyChroniclerImg from '../../../assets/badges/Daily-Chronicler.png';
import nightOwlImg from '../../../assets/badges/Night-Owl.png';
import earlyBirdImg from '../../../assets/badges/Early-Bird.png';
import minimalistImg from '../../../assets/badges/Minimalist.png';
import deepDiverImg from '../../../assets/badges/Deep-Diver.png';
import fullStackImg from '../../../assets/badges/Full-Stack.png';
import communityLeaderImg from '../../../assets/badges/Community-Leader.png';
import multimediaMasterImg from '../../../assets/badges/Multimedia-Master.png';
import infinityGauntletImg from '../../../assets/badges/Infinity-Gauntlet.png';
import marathonRunnerImg from '../../../assets/badges/Marathon-Runner.png';

export default function AchievementsContent() {

    const [achievements, setAchievements] = useState([]);
    const [loading, setLoading] = useState(false);

    useEffect(() => {
        const fetch_achievements = async () => {
            setLoading(true);
            try {
                // AICI VEI PUNE FETCH-UL REAL CATRE BACKEND:
                // const resp = await fetch('http://localhost:5019/achievements', ...);

                // --- DATE PENTRU ACHIEVEMENTS CU IMAGINILE TALE ---
                const dummyData = [
                    { 
                        id: 1, 
                        title: 'Daily Chronicler', 
                        description: 'Created a note 7 days in a row.', 
                        image: dailyChroniclerImg,
                        unlocked: true, 
                        date: '2023-12-01' 
                    },
                    { 
                        id: 2, 
                        title: 'Night Owl', 
                        description: 'Edited a note between 2 AM and 5 AM.', 
                        image: nightOwlImg,
                        unlocked: true, 
                        date: '2023-12-05' 
                    },
                    { 
                        id: 3, 
                        title: 'Early Bird', 
                        description: 'Created a note before 7 AM.', 
                        image: earlyBirdImg,
                        unlocked: false, 
                        date: null 
                    },
                    { 
                        id: 4, 
                        title: 'Minimalist', 
                        description: 'Created a note with less than 50 words.', 
                        image: minimalistImg,
                        unlocked: true, 
                        date: '2023-12-10' 
                    },
                    { 
                        id: 5, 
                        title: 'Deep Diver', 
                        description: 'Wrote a single note with over 2000 words.', 
                        image: deepDiverImg,
                        unlocked: false, 
                        date: null 
                    },
                    { 
                        id: 6, 
                        title: 'Full Stack', 
                        description: 'Used all types of tags in a single week.', 
                        image: fullStackImg,
                        unlocked: false, 
                        date: null 
                    },
                    { 
                        id: 7, 
                        title: 'Community Leader', 
                        description: 'Created a group with more than 5 members.', 
                        image: communityLeaderImg,
                        unlocked: true, 
                        date: '2023-11-20' 
                    },
                    { 
                        id: 8, 
                        title: 'Multimedia Master', 
                        description: 'Uploaded 10 images in your notes.', 
                        image: multimediaMasterImg,
                        unlocked: false, 
                        date: null 
                    },
                    { 
                        id: 9, 
                        title: 'Marathon Runner', 
                        description: 'Studied for 4 hours straight (active session).', 
                        image: marathonRunnerImg,
                        unlocked: false, 
                        date: null 
                    },
                    { 
                        id: 10, 
                        title: 'Infinity Gauntlet', 
                        description: 'Collected all other achievements.', 
                        image: infinityGauntletImg,
                        unlocked: false, 
                        date: null 
                    },
                ];

                setTimeout(() => {
                    setAchievements(dummyData);
                    setLoading(false);
                }, 300);

            } catch (err) {
                console.error("Eroare incarcare achievements:", err);
                setLoading(false);
            }
        };

        fetch_achievements();
    }, []);

    return (
        <div className="flex-1 p-6 overflow-auto h-full bg-gray-50">

            {/* Header */}
            <div className="mb-6 border-b pb-4">
                <div className="flex items-center justify-between">
                    <div className="flex items-center gap-3">
                        <div className="bg-purple-100 p-2 rounded-lg text-purple-600">
                            {/* Iconita trofeu header */}
                            <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 3v4M3 5h4M6 17v4m-2-2h4m5-16l2.286 6.857L21 12l-5.714 2.143L13 21l-2.286-6.857L5 12l5.714-2.143L13 3z" />
                            </svg>
                        </div>
                        <div>
                            <h2 className="text-2xl font-bold text-gray-800">Your Badges</h2>
                            <p className="text-sm text-gray-500">Collect them all to become a master!</p>
                        </div>
                    </div>

                    <div className="flex gap-3">
                         <div className="px-4 py-2 rounded-lg bg-white border text-sm text-gray-600 font-medium shadow-sm">
                            {achievements.filter(a => a.unlocked).length} / {achievements.length} Unlocked
                        </div>
                    </div>
                </div>
            </div>

            {/* Grid-ul cu Achievements */}
            {loading ? <p className="text-center text-gray-400 mt-10">Loading badges...</p> : (
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-4">
                    {achievements.map(ach => (
                        <div 
                            key={ach.id} 
                            className={`relative bg-white p-4 rounded-xl shadow-sm border transition-all duration-300 hover:shadow-md flex flex-col items-center text-center group ${
                                !ach.unlocked ? 'bg-gray-50 border-gray-200' : 'border-purple-100'
                            }`}
                        >
                            {/* Imaginea Badge-ului */}
                            <div className={`w-24 h-24 mb-3 transition-all duration-500 ${
                                ach.unlocked ? 'filter-none scale-100' : 'grayscale opacity-50 group-hover:scale-105'
                            }`}>
                                <img 
                                    src={ach.image} 
                                    alt={ach.title} 
                                    className="w-full h-full object-contain drop-shadow-md"
                                />
                            </div>

                            {/* Detalii Text */}
                            <h4 className={`font-bold text-lg mb-1 ${ach.unlocked ? 'text-gray-800' : 'text-gray-400'}`}>
                                {ach.title}
                            </h4>
                            <p className="text-xs text-gray-500 mb-3 h-8 line-clamp-2 px-2">
                                {ach.description}
                            </p>

                            {/* Footer Card */}
                            <div className="mt-auto w-full pt-3 border-t border-gray-100 flex justify-center">
                                {ach.unlocked ? (
                                    <span className="text-xs font-bold text-green-600 bg-green-50 px-3 py-1 rounded-full border border-green-100 flex items-center gap-1">
                                        <svg className="w-3 h-3" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 13l4 4L19 7" /></svg>
                                        Unlocked on {ach.date}
                                    </span>
                                ) : (
                                    <span className="text-xs font-bold text-gray-400 bg-gray-100 px-3 py-1 rounded-full border border-gray-200 flex items-center gap-1">
                                        <svg className="w-3 h-3" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 15v2m-6 4h12a2 2 0 002-2v-6a2 2 0 00-2-2H6a2 2 0 00-2 2v6a2 2 0 002 2zm10-10V7a4 4 0 00-8 0v4h8z" /></svg>
                                        Locked
                                    </span>
                                )}
                            </div>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
}
